import { Link } from "react-router-dom";
import './menuUsuario.scss'

export default function MenuUsuario(){
    return(
        <main className="menu-user">
            <div className="links">
                <Link>Dados Pessoais</Link>
                <Link>Cartões</Link>
                <Link>Endereços</Link>
                <Link>Meus Pedidos</Link>
                <Link>Sair</Link>
                
                    
               
            </div>
        </main>
    )
}
